import React, { Component } from 'react';
class Toolbar extends Component {
	render() {
		return (
			<div className="toolbar">
				<h3>{this.props.tool}</h3>
				<button onClick={this.props.onTool({ tool: 'zoom' })}>Zoom</button>
				<button onClick={(arrow) => this.props.onTool}>Arrow</button>
				<button onClick={(text) => this.props.onTool}>Text</button>
			</div>
		);
	}
}

export default Toolbar;
